import styled from "@emotion/styled";
import { FC } from "react";
import { CommentsProps } from "./Table";

const Box = styled("div")`
  display: flex;
  flex-direction: row;
  justify-content: space-between;
  align-items: center;
  padding: 16px 24px;
  gap: 36px;
  top: 50%;
  left: 50%;
  width: 600px;
  height: 56px;
  position: absolute;
  /* Neutral / 1 */

  background: #ffffff;
  box-shadow: inset 0px -1px 0px #f0f0f0;

  /* Inside auto layout */

  flex: none;
  order: 0;
  align-self: stretch;
  flex-grow: 0;

  transform: translate(-50%, -50%);

  background-color: white;
  border-radius: 2px;
  box-shadow: "0px 3px 6px -4px rgba(0, 0, 0, 0.12), 0px 6px 16px rgba(0, 0, 0, 0.08), 0px 9px 28px 8px rgba(0, 0, 0, 0.05)";
  p: 4;
`;
export const ModalInfo = ({ com, ...props }: any) => {
  console.log(com);
  const { handleClose } = props;

  return (
    <>
      <Box>
        <h3>Comments</h3>
        {com.map((i: { name: any }) => i.name)}
        <button onCanPlay={handleClose}>close</button>
      </Box>
    </>
  );
};
